script: |
  super -f text -I q8256.spq | sort > q8256.out

inputs:
  - name: q8256.spq
    data: |
      SELECT - + COUNT ( * ) * - 34 + COUNT ( * ) * ( - COUNT ( * ) ) FROM tab0 (FORMAT parquet) WHERE NOT + col1 / 92 + - + col2 - - col0 IS NULL;
  - name: tab0

outputs:
  - name: q8256.out
    data: |
      93
